How would I retrieve a CSV file that I stored in MongoDB?<p>I am able to upload a CSV document to my MongoDB server using GridFS. However, I seem to be having issues retrieving the CSV data from the database to parse. It might be something simple I am overlooking, but I am not sure. My code is below.</p>

<p>Back end snippet for uploading</p>

<pre><code>var storage = new GridFsStorage({ 
    url: mongoURI,
    file: (req, file) =&gt; {
      return new Promise((resolve, reject) =&gt; {
        const filename = file.originalname + Date.now()
        const fileInfo = {
            filename: filename,
            bucketName: 'Uploads',
        }
        resolve(fileInfo)
      });
    }
  });
  const upload = multer({ storage });

routerUpload.post('/upload', upload.single('files'), (req, res) =&gt; {
    //res.json({file: req.file})
    res.redirect('/')
})
</code></pre>

<p>Front end snippet for retrieving via Axios</p>

<pre><code>axios
.get(`http://localhost:5000/api/files/${fileName}`)
.then(res =&gt; {
  console.log(res.data)
})
.catch(err =&gt; 
{
  console.log(err)
})
</code></pre>

<p><code>res.data</code> returns this in the console</p>

<pre><code>{_id: "5d9df2605cbe7e430047616f", length: 59, chunkSize: 261120, uploadDate: "2019-10-09T14:44:48.526Z", filename: "TestDocument.csv", …}
chunkSize: 261120
contentType: "application/vnd.ms-excel"
filename: "TestDocument.csv"
length: 59
md5: "3d203d830d4c39ea7dabfb4562aa5032"
