<p>I googled it with this unexpected behavior but I didn't find any solution. So I had to restart server when it hangs..</p>
<p>To help understanding, here's my case :</p>
<ol>
<li>I'm using MongoDB Cloud manager and DB instances are hosted on AWS EC2</li>
<li>I'm using ReplicaSet and my read preference is <code>secondaryPreferred</code>. So all read operations are going toward the secondary node.</li>
<li>MongoDB version is 3.2</li>
<li>I created index for every fields used in the query (per field)</li>
<li>I executed same query both in Primary Node and Secondary Node (with <code>slaveOk</code>)</li>
